INSERT INTO `cms_page` VALUES (1,'404 Not Found','two_columns_right','Page keywords','Page description','no-route',NULL,'<div class=\"page-title\">\r\n<h1>Error 404</h1>\r\n</div>\r\n<dl><dt>La p&aacute;gina que has solicitado no ha sido encontrada, puede ser por:</dt><dd>\r\n<ul class=\"disc\">\r\n<li>Si has escrito la URL directamente, aseg&uacute;rese de que la ha introducido bien.</li>\r\n<li>Si has utilizado un link, el link est&aacute; caducado.</li>\r\n</ul>\r\n</dd></dl><dl><dt>&iquest;Qu&eacute; puedes hacer?</dt><dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1); return false;\">Ir a la p&aacute;gina anterior</a></li>\r\n<li>Usar la barra de navegaci&oacute;n para encontrar lo que estas buscando.</li>\r\n<li>Haz click en estos links para ir a la p&aacute;gina principal o para acceder a tu cuenta<br /><a href=\"{{store url=\"\"}}\">P&aacute;gina principal</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">Mi cuenta</a></li>\r\n</ul>\r\n</dd></dl>','2015-07-09 21:29:45','2018-04-19 18:19:11',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(2,'CEREBAG','one_column',NULL,NULL,'home',NULL,'<div class=\"hidden\">Homepage</div>','2015-07-09 21:29:45','2018-04-17 15:39:11',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(3,'About Us','two_columns_right',NULL,NULL,'about-magento-demo-store',NULL,'<div class=\"page-title\">\r\n<h1>About Magento Store</h1>\r\n</div>\r\n<div class=\"col3-set\">\r\n<div class=\"col-1\">\r\n<p style=\"line-height: 1.2em;\"><small>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Morbi luctus. Duis lobortis. Nulla nec velit. Mauris pulvinar erat non massa. Suspendisse tortor turpis, porta nec, tempus vitae, iaculis semper, pede.</small></p>\r\n<p style=\"color: #888; font: 1.2em/1.4em georgia, serif;\">Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Morbi luctus. Duis lobortis. Nulla nec velit. Mauris pulvinar erat non massa. Suspendisse tortor turpis, porta nec, tempus vitae, iaculis sem